import React from 'react'
import { Row, Col, Divider } from 'antd';
import 'antd/dist/antd.css';
function Detail(){
    return(
        <Row gutter={[16, 16]}>
            <Col span={6} ></Col>
            <Col span={12}>
                <Row>
                    <Col span={12}> </Col>
                    <Col ></Col>
                </Row>
            </Col>
            <Col span={6} ></Col>
        </Row>
    )
}
export default Detail
